import React from 'react';
import './App.css';
import { Route, Switch } from 'react-router-dom';
import { GenerateQRCode } from './layouts/GenerateQRCode/GenerateQRCode';

function App() {
  return (
      <Switch>
        <Route path={"/generateQRCode"}>
          <GenerateQRCode/>
      </Route>
    </Switch>
  );
}

export default App;
